import React, {useeffect, useState} from 'react';
import { withRouter } from "react-router";





const Data = ()=>{
    const [hello, setHEllo] = useState('hello')
      useeffect(()=>{
          setHEllo()
      })
      
    
    return(
        <>
     <h2>Data</h2>
        </>
    )
}


export default withRouter(Data)
